import React from "react";
import "./Card.css"; // Import CSS for card styling

const Card = ({ children, title }) => {
  return (
    <div className="card">
      <div className="card-content">
        <h2 className="card-title">{title}</h2>
        <div className="card-body">{children}</div>
      </div>
    </div>
  );
};

export default Card;
